import React, { useState, useEffect } from 'react';
import { getInventoryTransactions, createInventoryTransaction } from '../services/api';

const Inventory = () => {
    const [transactions, setTransactions] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [filter, setFilter] = useState({
        type: '',
        startDate: null,
        endDate: null
    });
    const [newTransaction, setNewTransaction] = useState({
        productId: '',
        transactionType: 'In',
        quantity: '',
        unitPrice: '',
        notes: '',
        createdById: user?.id || ''
    });

    useEffect(() => {
        const fetchTransactions = async () => {
            try {
                setLoading(true);
                const data = await getInventoryTransactions(filter);
                setTransactions(data);
                setError(null);
            } catch (err) {
                setError(err.message || 'Failed to fetch transactions');
                console.error('Error:', err);
            } finally {
                setLoading(false);
            }
        };

        fetchTransactions();
    }, [filter]);

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await createInventoryTransaction(newTransaction);
            // Refresh transactions list
            fetchTransactions();
            // Reset form
            setNewTransaction({
                productId: '',
                transactionType: 'In',
                quantity: '',
                unitPrice: '',
                notes: '',
                createdById: user?.id || ''
            });
        } catch (error) {
            setError(error.message);
        }
    };

    if (loading) return <div>Loading...</div>;
    if (error) return <div>Error: {error}</div>;

    return (
        <div>
            <h2>Inventory Transactions</h2>
            
            {/* Add Transaction Form */}
            <form onSubmit={handleSubmit}>
                <select
                    value={newTransaction.transactionType}
                    onChange={(e) => setNewTransaction({
                        ...newTransaction,
                        transactionType: e.target.value
                    })}
                    required
                >
                    <option value="In">In</option>
                    <option value="Out">Out</option>
                    <option value="Adjustment">Adjustment</option>
                    <option value="Purchase">Purchase</option>
                    <option value="Return">Return</option>
                </select>
                {/* Add other form fields */}
                <button type="submit">Create Transaction</button>
            </form>

            <table>
                <thead>
                    <tr>
                        <th>Product</th>
                        <th>Type</th>
                        <th>Quantity</th>
                        <th>Date</th>
                        <th>Created By</th>
                    </tr>
                </thead>
                <tbody>
                    {transactions.map(transaction => (
                        <tr key={transaction.id}>
                            <td>{transaction.productName}</td>
                            <td>{transaction.transactionType}</td>
                            <td>{transaction.quantity}</td>
                            <td>{new Date(transaction.transactionDate).toLocaleDateString()}</td>
                            <td>{transaction.createdBy?.firstName} {transaction.createdBy?.lastName}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Inventory;
